import React from 'react'

export default function ActivitiesDetail({actsDetail}) {
console.log(actsDetail, 'fawegwegwgegh');
let act = actsDetail;

  return (
    <div>
        {
            act?.map(el =>  (
                <ul>
        <h3>{el.name}</h3>
        <h3>{el.duration}</h3>
        <h3>{el.difficulty}</h3>
        <h3>{el.season}</h3>
        </ul>))
        }
        
    </div>
  )
};
